import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { useSelector, useDispatch } from 'react-redux'
import { useNavigate } from "react-router-dom";
import {postUser} from '../../features/User/UserSlice';
import { Password } from '@mui/icons-material';
const defaultTheme = createTheme();

export default function SignIn() {

  let dis= useDispatch()

  let userAdd={
      tz:"",
      fullName:"",
      Password:"",
      telephone:"",
      city:"",
      street:"",
      houseNumber:""
  }
  
      const add=(e)=>{
          e.preventDefault()// מבטל ברירת מחדל 
          dis(postUser(userAdd))
      }
  return (
<ThemeProvider theme={defaultTheme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: 'lightpink' }}>
            <LockOutlinedIcon />
          </Avatar>
          <Typography component="h1" variant="h5">
            Sign Up
          </Typography>
          <Box component="form" noValidate 
          // onSubmit={handleSubmit}
           sx={{ mt: 3 }}>
            <Grid container spacing={2}>
            <Grid item xs={12} sm={6}>
                <TextField
                  autoComplete="given-name"
                  name="Identity"
                  required
                  fullWidth
                  id="Identity"
                  label=" Identity"
                  autoFocus
                  onChange={(e)=>userAdd.tz=e.target.value}

                  InputLabelProps={{
                    style: { color: 'black' }, // Inline style for label
                  }}
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  autoComplete="given-name"
                  name="fullName"
                  required
                  fullWidth
                  id="fullName"
                  label=" fullName"
                  autoFocus
                  onChange={(e)=>userAdd.fullName=e.target.value}

                  InputLabelProps={{
                    style: { color: 'black' }, // Inline style for label
                  }}
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="password"
                  label="Password"
                  type="password"
                  id="password"
                  autoComplete="new-password"
                  onChange={(e)=>userAdd.password=e.target.value}

                  InputLabelProps={{
                    style: { color: 'black' }, // Inline style for label
                  }}
                  
                />
              </Grid>

            </Grid>
            <Button
            color='inherit'
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2, bgcolor:'lightpink' }}
            >
              Sign Up
            </Button>
            <Grid container justifyContent="flex-end">
              <Grid item>
                <Link  href="\login" style={{ color: 'pink' ,textDecoration:'none'}} >
                  Already have an account? Sign in
                </Link>
              </Grid>
            </Grid>
          </Box>
        </Box>
      </Container>
    </ThemeProvider>
  );
}
